import React from 'react';
import Header from './Header'
import css from './index.css';
import Footer from './Footer';
import Creatnote from './Creatnote'
import Note from './Note'

const App = () => {

  const addnote = (note) => {
    alert('i am clicked');
  }

 return(
   <>
  <Header/>
  <Footer/>
  <Creatnote prevData={addnote}/>
  <Note/>
   </>
 );

}

export default App;
